import { Link } from "react-router-dom";

function App() {
  return (
    <main className="p-10 w-[700px] m-auto">
      <header className="flex justify-between mb-10">
        <Link to={"/"} className="font-bold text-2xl">
          Flowrite
        </Link>
        <nav className="flex gap-5">
          <Link to={"/"}>Login</Link>
          <Link to={"/"}>Register</Link>
        </nav>
      </header>

    </main>
  );
}

export default App;
